import React, {Component} from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';


import './styles/App.css';

class App extends Component {
    render() {
        return (
            <Container>

                <Row className='justify-content-md-center'>
                    <Col sm={5}>
                        <Form>
                            <Form.Group as={Row} controlId="formBasicEmail">
                                <Form.Control  column sm={2} type="text" placeholder="Pick up:"/>
                                <Col sm={10}>
                                <img alt='' src='https://static.talixo.de/images/icon_help.png'/>
                                </Col>
                            </Form.Group>
                            <Form.Group controlId="formBasicPassword">
                                <Form.Control type="text" placeholder="Destination:"/>
                            </Form.Group>
                            <Form.Group controlId="formBasicVoucher">
                                <Form.Control type="voucher" placeholder="Voucher code (optional)"/>
                            </Form.Group>
                            <Button variant="danger" size="lg" block>
                                Start booking
                            </Button>
                        </Form>
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default App;
